import React from 'react'
import List from './ListCategory'

class SideBar extends React.Component{

    render() {
        let list = List;
        return <div >{
            list.map((value => {
                return <div >
                    <label className="containerForTree">{value.name}
                        <input type="checkbox" />
                        <span className="checkmark"></span>
                    </label>
                </div>
            }))
        }
        </div>
    }


}

export default SideBar

